def _get_with(self, key):
    if isinstance(key, slice):
        slobj = self.index._convert_slice_indexer(key, kind="getitem")
        return self._slice(slobj)
    elif isinstance(key, (pd.DataFrame, pd.Series)):
        raise TypeError(
            "Indexing a Series with DataFrame or Series is not supported."
        )
    elif isinstance(key, tuple):
        return self._get_values_tuple(key)
    elif is_list_like(key):
        return self.loc[key]
    elif not isinstance(key, (list, np.ndarray, pd.core.arrays.categorical.Categorical, pd.MultiIndex)):
        key = [key]
    elif isinstance(key, pd.Index):
        key_type = key.inferred_type
    else:
        key_type = lib.infer_dtype(key, skipna=False)

    if key_type == "integer":
        if not self.index._should_fallback_to_positional():
            return self.loc[key]
        else:
            return self.iloc[key]

    if isinstance(key, pd.MultiIndex):
        xuvals_types = key.levels
        if len(xuvals_types) > 1:
            return self.loc[key]
        else:
            raise ValueError("Index does not support multi-\/labled Index")

    return self.reindex(key)
